#define DONT_CLEAR_DATA		-1

int BYTES_PER_WRITE2 = 0x6000;


void read_file2(const char *file)
{
   int fd = 0; uint64_t pos, read_e = 1;

   if (cellFsOpen(file, CELL_FS_O_RDONLY, &fd, NULL, 0) == CELL_FS_SUCCEEDED)
   {
      char *data = (char *)malloc(BYTES_PER_WRITE);
      while (read_e)
      {
         if (cellFsRead(fd, (void *)(data), BYTES_PER_WRITE2, &read_e) == CELL_FS_SUCCEEDED)
         {
            printf("data: 0x%X\n", data);
            printf("read_e: 0x%X\n", read_e);
            CCAPIWriteProcessMemory(GAME_PROC_ID, (void *)(BO2_DESTINY_START_ADR + next_write), data, read_e);
            next_write += read_e;
            BYTES_PER_WRITE2 = read_e;
            printf("read_e: 0x%X\n", read_e);
            printf("next_write: 0x%X\n", next_write);
            if (data)
            {
               printf("free mem\n");
               free(data);
               data = (char *)malloc(BYTES_PER_WRITE);
            }
         }
      }

      printf("close file\n");
      free(data);
      cellFsClose(fd);
   }

}

















