struct ProcessName
{
   char value[512];
};

int CCAPIGetProcessList(uint32_t* npid, uint32_t* pids)
{
   uint64_t ret = sys_ccapi_call(0x630, npid, pids);
   printf("0x630 ret: 0x%X\n", ret);
   return ret;
}
int CCAPIGetProcessName(uint32_t pid, ProcessName* name)
{
   uint64_t ret = sys_ccapi_call(0x700, pid, name);
   printf("0x700 ret: 0x%X\n", ret);
   return ret;
}